import React from 'react';
import '/src/components/index.css'; // Import the CSS file

function Header() {
  return (
    <header className="header">
      {/* Logo Section */}
      <div className="logo-container">
        <img src="../assets/logopadiumkm.jpg" alt="Logo PaDi UMKM" className="logo" />
        <div className="logo-text">
          <p className="logo-title">PaDi UMKM</p>
          <p className="logo-subtitle">Pasar Digital UMKM Indonesia</p>
        </div>
      </div>

      {/* Navigation Links */}
      <nav className="nav">
        <a href="/" className="nav-link active">Beranda</a>
        <a href="/about" className="nav-link">Tentang Kami</a>
        <a href="/help" className="nav-link">Bantuan</a>
        <a href="/media" className="nav-link">Media</a>
        <a href="/contact" className="nav-link">Kontak</a>
      </nav>

      {/* Login Button */}
      <div className="login-container">
        <a href="/login" className="login-button">Login</a>
      </div>
    </header>
  );
}

export default Header;
